def trimData():
    flag = False
    for row in dict(data):
        if data[row][0] == "#" or flag:
            flag = True
            del data[row]

def getPeriodo():
    for ind in data:
        if data[ind][0] in ["RSF", "V"]:
            per1 = data[ind][3]
            per2 = data[ind][4]
            m1 = monthsToNumber[per1[:3]]
            a1 = int(per1[3:])
            m2 = monthsToNumber[per2[:3]]
            a2 = int(per2[3:])

            if m2 >= m1:
                ad = a2 - a1
                md = m2 - m1
                md += ad * 12
            else:
                ad = a2 - a1
                if ad >= 1:
                    ad -= 1
                    md = 12 + m2 - m1
                md += ad * 12
            data[ind][3] = md + 1
            
            if a2 > lyy or (a2 == lyy and m2 >= lym):
                if a1 > lyy or (a1 == lyy and m1 >= lym):
                    data[ind][2] = md + 1
                else:
                    if m2 >= lym:
                        ad = a2 - lyy
                        md = m2 - lym
                        md += ad * 12
                    else:
                        ad = a2 - lyy
                        if ad >= 1:
                            ad -= 1
                            md = 12 + m2 - lym
                    data[ind][2] = md + 1
            else:
                data[ind][2] = 0
            
def comparePeriods(per1, per2):
    m1 = monthsToNumber[per1[:3]]
    a1 = int(per1[3:])
    m2 = monthsToNumber[per2[:3]]
    a2 = int(per2[3:])
    if a2 > a1:
        return per2
    elif a1 > a2:
        return per1
    else:
        if m2 > m1:
            return per2
    return per1

